import React from 'react'
import { View, Text, StyleSheet } from 'react-native'

const Footer = () => {
    return (
        <View>
            <Text style={styles.footer}>FZ Smart Que By AIRPORTS OF THAILAND PLC. v. 1.0.0</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    footer: {
      textAlign: 'center'
    }
  });


export default Footer;
